import '../css/home.css';
// import MediaQuery from 'react-responsive';

function Home() {
  return (
    <div className="home">
      <h1> TV Shows </h1>
      <div className="home-container">
        <div className="showBox show-1">
          <h4> Show Name </h4>
          <img src ="http://www.gstatic.com/tv/thumb/tvbanners/183931/p183931_b_v8_ac.jpg" />
          <p> So get a witch's shawl on a broomstick you can crawl on. Were gonna pay a call on the Addams Family. And when the odds are against him and their dangers work to do. You bet your life Speed Racer he will see it through. Movin' on up to the east side. </p>
        </div>
        <div className="showBox show-2"></div>
        <div className="showBox show-3"></div>
        <div className="showBox show-4"></div>
      </div>
    </div>
    )
}


export default Home;
